import React, {useState} from 'react'
import TesterResultsList from "./TesterResultsList"
import TesterSearchBar from "./TesterSearchBar"

const Test = () => {
  const [results, setResults] = useState([]);

  return (
    <div>
    <TesterSearchBar setResults={setResults}/>

    <TesterResultsList />
    </div>
  )
}

export default Test
